(for [setting-2 [:MMSIB :MSSIB :MAP :FEC :EO :IMS :MSSOB :OOE :MMSOB :NMSS :MSSR :MU :ISS :ISSR :EYS :MMS :MUOB :NMSSR]]
	(-> (rollup-alpha-beta-by (juxt :calendar-year :academic-year-1) (setting-1? setting-2) (filter leaver? (get-transitions)))
        (format-for-ribbon)
        (ribbon-plot (str "Probability of leaving from " (name setting-2)) :ncy2013 [:lower2013 :upper2013] [:lower2014 :upper2014] [:lower2015 :upper2015] [:lower2016 :upper2016])))
