(def f (juxt :academic-year-1 (comp str :setting-2)))

(defn area-plot
  [title df]
  (gg4clj/view [[:<- :foo (gg4clj/data-frame df)]
                (gg4clj/r+
                  [:ggplot :foo [:aes {:x :ncy :y :v :fill [:factor :setting]}]]
                  [:ggtitle title]
                  [:geom_bar {:stat "identity"}]
                  #_[:stat_smooth {:geom "area" :method "gam" :span 0.5 :alpha 0.2}])]))

(def data
  (->> (filter mover? (get-transitions))
     (reduce (fn [coll transition]
               (update coll (f transition) u/some+ 1))
             {})))


(defn tabulate-all
  [stacked? data]
  (let [[xs ys] (apply map vector (keys data))
        xs (distinct xs)
        ys (distinct ys)
        totals (reduce (fn [coll x]
                         (assoc coll x
                           (reduce (fn [n y] (+ n (get data [x y] 0))) 0 ys)))
                       {} xs)]
    (for [y (sort ys)
          x (sort xs)]
      [x y (if stacked? (double (/ (get data [x y] 0) (get totals x))) (get data [x y] 0))])))


(for [calendar-year (range 2013 2017)]
  (->> (get-transitions)
       (filter mover?)
       (filter #(= (:calendar-year %) calendar-year))
       (reduce (fn [coll transition]
                 (update coll (f transition) u/some+ 1))
               {})
       (tabulate-all true)
       (apply map vector)
       (zipmap [:ncy :setting :v])
       (area-plot (str "Probability of moving into setting " calendar-year))))
