(defn gather-set-data [data]
  (->> (reduce (fn [coll {:keys [setting-1 setting-2]}]
                 (update coll [setting-1 setting-2] u/some+ 1))
               {}
               data)
       (mapcat (fn [i [[s1 s2] v]]
                  (vector {:id i :x "NCY 6" :y (name s1) :value v}
                          {:id i :x "NCY 7" :y (name s2) :value v}))
               (range))))

(defn seq-of-maps->data-frame
  [coll]
  (when-let [x (first coll)]
    (let [ks (keys x)
          f (apply juxt ks)]
      (zipmap ks (apply map vector (map f coll))))))

(defn sankey [df]
  (gg4clj/view
    [[:require "ggforce"]
     [:<- :foo (gg4clj/data-frame df)]
     (gg4clj/r+
       [:ggplot :foo [:aes :x {:id :id :split :y :value :value}]]
       [:geom_parallel_sets {:alpha 0.3 :axis.width 0.1}]
       [:geom_parallel_sets_axes {:axis.width 0.1}]
       [:geom_parallel_sets_labels {:color "white"}])]))

(->> (filter mover? (get-transitions))
     (filter #(= (:calendar-year %) 2016))
     (filter #(= (:academic-year-1 %) 6))
     (gather-set-data)
     (seq-of-maps->data-frame)
     (sankey))
